import logo from "./logo.svg";
import "./App.css";
import {
  Box,
  Button,
  Grid,
  makeStyles,
  Paper,
  TextField,
  Typography,
} from "@material-ui/core";
import Header from "./Header";
import { createMuiTheme, MuiThemeProvider } from "@material-ui/core/styles";
import MenuIcon from "@material-ui/icons/Menu";
import React from "react";
import { Helmet } from "react-helmet";
import { blue, green, grey, purple } from "@material-ui/core/colors";

// minter, sharge, bounge, twee,

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    "& > *": {
      margin: theme.spacing(1),
      width: "25ch",
    },
  },
  paperMain: {
    padding: theme.spacing(2),
    textAlign: "center",
    backgroundColor: "#151619",
    height: "90vw",
    width: "93vw",
    paddingTop: 5,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    backgroundColor: "#eceded",
    height: "200vw",
    width: "93vw",
    paddingTop: 5,
  },
  header: {
    padding: theme.spacing(2),
    textAlign: "center",
    backgroundColor: "#151619",
    height: "25vw",
    width: "93vw",
    paddingTop: 5,
  },
  textField: {
    width: "90%",
    marginLeft: "auto",
    marginRight: "auto",
    paddingBottom: 0,
    marginTop: "10vw",
    fontWeight: 500,
    backgroundColor: "white",
  },
  input: {
    color: "white",
  },
  button: {
    width: "70%",
    marginLeft: "auto",
    marginRight: "auto",
    paddingBottom: "2vw",
    marginTop: "5vw",
    fontWeight: 500,
  },
  text: {
    marginTop: "5vw",
  },
}));

const theme = createMuiTheme({
  typography: {
    fontFamily: [
      "-apple-system",
      "BlinkMacSystemFont",
      '"Segoe UI"',
      "Roboto",
      '"Helvetica Neue"',
      "Arial",
      "sans-serif",
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"',
    ].join(","),
    fontSize: 12,
  },
  palette: {
    primary: {
      main: "#717a83",
    },
    secondary: {
      main: "#eceded",
    },
    textPrimary: {
      main: "#717a83",
    },
  },
});

function GridItem({ classes }, text) {
  return (
    // From 0 to 600px wide (smart-phones), I take up 12 columns, or the whole device width!
    // From 600-690px wide (tablets), I take up 6 out of 12 columns, so 2 columns fit the screen.
    // From 960px wide and above, I take up 25% of the device (3/12), so 4 columns fit the screen.
    <Grid item>
      <Paper className={classes.paper}>
        <Typography variant="h1" component="h2" color="#FFFFFF">
          h1. Heading
        </Typography>
      </Paper>
    </Grid>
  );
}

function App() {
  const classes = useStyles();

  return (
    <div className="App">
      <MuiThemeProvider theme={theme}>
        <Grid item>
          <Paper className={classes.header}>
            <Header />
          </Paper>
        </Grid>
        <Grid container spacing={2}>
          <Grid item>
            <Paper className={classes.paperMain}>
              <Typography variant="h4" component="h2" color="secondary">
                <Box fontWeight="fontWeightBold">
                  Aldri vært enklere å forvalte pengene dine
                </Box>
              </Typography>
              <Box>
                <TextField
                  id="outlined-basic"
                  label="E-post"
                  variant="outlined"
                  color={"secondary"}
                  className={classes.textField}
                  InputProps={{
                    className: classes.input,
                  }}
                />
              </Box>
              <Typography
                variant="h6"
                component="h2"
                color="primary"
                className={classes.text}
              >
                <Box>Enklere blir det ikke.</Box>
              </Typography>
              <Box>
                <Button
                  variant="contained"
                  color="secondary"
                  className={classes.button}
                >
                  Kom i gang
                </Button>
              </Box>
            </Paper>
          </Grid>
          <Grid item>
            <Paper className={classes.paper}>
              <Typography variant="h1" component="h2" color="#FFFFFF">
                h1. Heading
              </Typography>
            </Paper>
          </Grid>
          <Grid item>
            <Paper className={classes.paper}>
              <Typography variant="h1" component="h2" color="#FFFFFF">
                h1. Heading
              </Typography>
            </Paper>
          </Grid>
          <Grid item>
            <Paper className={classes.paper}>
              <Typography variant="h1" component="h2" color="#FFFFFF">
                h1. Heading
              </Typography>
            </Paper>
          </Grid>
        </Grid>
      </MuiThemeProvider>
    </div>
  );
}

export default App;
